import React from 'react';
import ReturndAsh from './Dash';
import HashLoader from 'react-spinners/HashLoader';
import './Loading.css';

// Dash Component Admin
export default function AdmindAsh() {
 const [loading, setLoading] = React.useState(false);

 React.useEffect(() => {

  setLoading(true);
  setTimeout(() => {
   setLoading(false);
  }, 3600);

 }, []);

 return (
  <div>
   {
    loading ?
     <div className='App-loading'>
      <HashLoader
       size={80}
       color={'#123abc'}
       loading={loading}
      />
     </div>
     :
     <ReturndAsh />
   }
  </div>
 )
};
